import React from 'react';
import Card from './Card';


const CardList = ({grass}) =>{
    return(
        <div>
            {
                grass.map((user, i) =>{
                    return(
                        <Card
                        key={grass[i].id}
                        id={grass[i].id}
                        name={grass[i].name}
                        speed={grass[i].speed}
                        />)
                })
            }
        </div>
    )
}

export default CardList;
